class Fila {
    constructor(id, type, name, startTime, duration, elapsedTime) {
      this.id = id;
      this.type = type;
      this.name = name;
      this.startTime = startTime;
      this.duration = duration;
      this.elapsedTime = elapsedTime;
    }
  
    editarCampo(campo, valor) {
      this[campo] = valor;
    }
  }
  
  module.exports = Fila;
